            title: `Soy enterrador y vengo de enterrar mi coraz√≥n`,
            description: `El 27 de enero de 2022, mi m√°s importante compa√±√≠a, mi amiga m√°s incondicional, el ser m√°s noble‚Ä¶ mi vida entera y m√°s grande amor y yo, nos despedimos. Hoy me sacude este nuevo comienzo y tambalea mi propia identidad. Quiz√° s√≠ intente alguna vez pegar los pelos del perro a ver si alguna vez lo vuelvo a armar‚Ä¶ Aunque mientras tanto, deba abrir la puerta de nuestro hogar sin su presencia y el movimiento pendular de su cola en signo de agradecimiento y amor infinito.<br>¬°En serio!, no quiero que los d√≠as pasen y se desprendan sus pelitos de mi ropa, es lo √∫nico que tengo, porque en mi memoria no conf√≠o, no quiero que los d√≠as pasen y empiece a tener flashbacks inconexos intentando recordar una imagen difuminada por mi capacidad mental de fragmentos incompletos e inconclusos cuando m√°s quisiese retenerlo todo como una grabaci√≥n en la que puedo hacer zoom y reenfocar la mirada en su mirada gu√≠a, en su rostro que dec√≠a ‚ÄúTodo va a estar bien‚Äù. Sus ojitos se apagaron sobre m√≠, pero me dijo que confiara en mi coraz√≥n, aunque hoy se encuentre en completa incertidumbre. Este salto cu√°ntico era necesario para tomar la responsabilidad sobre m√≠ y crear un cambio real desde adentro, tomando como base la ense√±anza que me dejaste sobre el amor y lo que puede transformar al mundo. Gracias por ser la pieza m√°s importante para que este ser encontrara su misi√≥n con todo lo que me permitiste experimentar desde la bondad. Gracias a tu vida, gracias por salvarme, gracias por darme el privilegio de estar juntas hasta el √∫ltimo instante de ti sobre esta superficie terrestre, gracias por elegirme y entregarme cada uno de tus d√≠as. Jam√°s hab√≠a conocido la magnitud de una fortaleza como la tuya, porque ni aun pasando por d√≠as de dolor dejaste de ser esa perra alegre y juguetona, pero sabia y serena cuando m√°s lo necesit√°bamos. Tu familia te ama con toda el alma, y yo‚Ä¶ te guardo siempre en m√≠, porque eres y ser√°s mi todo, espero verte de nuevo. Te amo por siempre, nariz.`,
